import React, { useState } from 'react'
import UserService from '../../services/user.service';
import AuthService from '../../services/auth.service'
import './UserDashboard.css'

function UserDashboard() {

    const [user, setUser] = useState({
        aplicarii: []
    });
    const currentUser = AuthService.getCurrentUser();
    UserService.getUserAplicarii(currentUser.id).then(
        response => {
            setUser(response.data);
        }
    );



    return (
        <div id="page-wrapper chiller-theme toggled">
          <a id="show-sidebar" className="btn btn-sm btn-dark" href="#"> <i className="fas fa-bars"></i></a>
           <nav id="sidebar" className="sidebar-wrapper">
             <div classame="sidebar-content">
                <div className="sidebar-brand">
                      <a href="#">Boostrap 4 sidebar</a>
                      <div id="close-sidebar">
                         <i className="fas fa-times"></i>
                      </div>
                </div>

                <div className="sidebar-header">
                     <div className="user-pic">
                            <img className="img-responsive img-rounded" src="./images/cap.png" alt="user-pic"/>
                     </div>
                     <div className="user-info">
                          <span className="user-name">Matei <strong>Alexandru</strong></span>
                          <span className="user-role">Administrator</span>
                          <span className="user-status">
                              <i className="fa fa-circle"></i>
                              <span>Online</span>
                          </span>
                     </div>
                </div>
             
             </div>
           </nav>

    </div>

   

    )
}

export default UserDashboard


